    }
    ll &ret = dp[i][take];
    if (vis[i][take] == vid)return ret;
    vis[i][take] = vid;
    int posw = i - take;
    ret = rec(i + 1, take) + arr[i][posw];
    if (take < B)
        ret = max(ret, rec(i + 1, take + 1) + arr[i][W + take + 1]);
    return ret;
}
