.skip-to-content-link {
  position: absolute;
  height: 48px;
  display: flex;
  justify-content: center;
  align-content: center;
  font-size: 2rem;
  top: -56px;
  left: 6px;
  background: #000;
  color: #fff !important;
  padding: calc(var(--gap, 8px) * 1) calc(var(--gap, 8px) * 2);
  z-index: 100;
  transition: top 0.3s;
}
.skip-to-content-link:focus {
  top: 6px;
}

.wt-page-loading {
  overflow: hidden;
}

.wt-page-loader {
  position: fixed;
  background-color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100vw;
  height: 100vh;
  z-index: 100;
}
.wt-page-loading .wt-page-loader {
  animation: loader-in 0.01s linear 1;
  opacity: 1;
}
body:not(.wt-page-loading) .wt-page-loader {
  opacity: 0;
  transform: scale(0);
  transition: opacity 0.3s, transform 0.1s 0.3s;
}

@keyframes spinner-ring {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.spinner-ring {
  --border-size: 3px;
  --spinner-size: 64px;
  display: inline-block;
  width: var(--spinner-size);
  height: var(--spinner-size);
  border: var(--border-size) solid var(--swiper-scrollbar-track-color, #eee);
  position: relative;
  border-radius: 50%;
}
.spinner-ring::after {
  content: " ";
  display: block;
  position: absolute;
  top: calc(-1 * var(--border-size));
  left: calc(-1 * var(--border-size));
  width: var(--spinner-size);
  height: var(--spinner-size);
  border-radius: 50%;
  border: var(--border-size) solid var(--swiper-theme-color);
  border-color: var(--swiper-theme-color) transparent transparent transparent;
  animation: spinner-ring 1.2s linear infinite;
}

.pic-lazy {
  filter: blur(7px);
  background-repeat: no-repeat;
  background-size: cover;
  display: block;
}
.wt-mosaic__aside .pic-lazy {
  height: 100%;
}
.pic-lazy.hero__pic {
  width: 100%;
}
.pic-lazy [loading=lazy] {
  opacity: 0;
  transition: opacity 250ms ease-in-out;
}
.pic-lazy::before {
  content: "";
  position: absolute;
  inset: 0;
  opacity: 0;
  animation: pulse 2.5s infinite;
  background-color: white;
}
.pic-lazy.loaded {
  filter: none;
}
.pic-lazy.loaded [loading=lazy] {
  opacity: 1;
}
.pic-lazy.loaded::before {
  animation: none;
  z-index: -1;
}

@keyframes pulse {
  0% {
    opacity: 0.05;
  }
  50% {
    opacity: 0.35;
  }
  100% {
    opacity: 0.05;
  }
}
hr {
  display: block;
  border: 0;
  margin: 0;
  height: 1px;
  width: 100%;
  background-color: currentColor;
  color: inherit;
}

main section {
  clear: both;
